import React from 'react'

export default function Cart() {
  return (
    <div className='CartDiv'>
        <div className="col-3 CartHeadings">Product</div>
        <div className="col-3 CartHeadings">Price</div>
        <div className="col-3 CartHeadings">Quantity</div>
        <div className="col-3 CartHeadings">Subtotal</div>
    </div>
  )
}
